<script>




    function cambiarColorSeccion(idSeccion, nuevoColor) {
        var paths = document.querySelectorAll('path.FirstSection'); // Selecciona todos los elementos path con la clase FirstSection
            
            // Establecer todos los colores en blanco
            paths.forEach(function(path) {
                path.style.fill = '#E7E6E8';
            });

            // Cambia el color del path con el id correspondiente
            paths.forEach(function(path) {
                if (path.id === idSeccion) {
                    path.style.fill = nuevoColor;
                }
            });
        }

        function mostrarMensaje(nombreSeccion) {
                
            cambiarColorSeccion(nombreSeccion, '#B7C99A'); // Cambia el color del path correspondiente al nombreSeccion
        }


</script>

